INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (-416.5, 3001100, 2.1, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 130011, 100, 2, "ヤマト", "2024/10/31 12:00:00", "2030/01/01 14:59:59", 3001, 0.0, 1);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (-416.5, 3001101, 5.68, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 130011, 101, 2, "ヤマト", "2024/10/31 12:00:00", "2030/01/01 14:59:59", 3001, 0.0, 4);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (-416.5, 3001102, 0.0, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 130011, 102, 1, "ヤマト", "2024/10/31 12:00:00", "2030/01/01 14:59:59", 3001, 0.0, 1);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (-416.5, 3002100, 0.0, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 130211, 100, 1, "フブキ", "2024/10/31 12:00:00", "2030/01/01 14:59:59", 3002, 0.0, 1);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (-416.5, 3002101, 0.0, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 130211, 101, 1, "フブキ", "2024/10/31 12:00:00", "2030/01/01 14:59:59", 3002, 0.0, 1);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (-416.5, 3002102, 8.53, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 130211, 102, 2, "フブキ", "2024/10/31 12:00:00", "2030/01/01 14:59:59", 3002, 0.0, 5);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (-416.5, 3002103, 5.67, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 130211, 103, 1, "フブキ", "2024/10/31 12:00:00", "2030/01/01 14:59:59", 3002, 0.0, 7);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (-416.5, 3002104, 0.0, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 130211, 104, 1, "フブキ", "2024/10/31 12:00:00", "2030/01/01 14:59:59", 3002, 0.0, 1);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (-416.5, 3002300, 0.0, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 130211, 300, 3, "フブキ", "2024/10/31 12:00:00", "2030/01/01 14:59:59", 3004, 0.0, 3);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (-416.5, 3002400, 0.0, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 130211, 301, 7, "フブキ", "2024/10/31 12:00:00", "2030/01/01 14:59:59", 3005, 0.0, 7);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (-416.5, 3003200, 4.4, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 130211, 200, 1, "フブキ", "2024/10/31 12:00:00", "2030/01/01 14:59:59", 3003, 0.0, 2);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (-416.5, 3003201, 0.0, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 130211, 201, 7, "フブキ", "2024/10/31 12:00:00", "2030/01/01 14:59:59", 3003, 0.0, 7);
INSERT INTO `v1_a2961f53c5ba26459cc092ffc0ca37f051c1d0f9c246133d7581a6926f4b6774` VALUES (-416.5, 3003202, 5.6, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 130211, 202, 2, "フブキ", "2024/10/31 12:00:00", "2030/01/01 14:59:59", 3003, 0.0, 1);
